import React, { useState } from "react";
import "./App.css";
import Login from "./Login";
import proto from "./pb/proto_grpc_web_pb"
import { Routes, Route } from "react-router-dom";
import Subasta from "./Subasta";

var subastaService = new proto.SubastaServiceClient('http://0.0.0.0:8000');

function App(){
  const [info, setInfo] = useState(0)

  function takeSubastas(){
    var request = new proto.Empty();
    var metadata = {};
    subastaService.getSubastas(request, metadata, function(err, response) {
      if (err) {
        console.log(err.code, err.message);
      } else {
        console.log(response.getSubastasList());
      }
    });
  }

  return(
    <div className="App">
     {/*  <h1> Subastas! {info}</h1>
      <button href="#" onClick={takeSubastas}>Clickeame</button> */}
      <App>
        <Subasta />
      </App>
      <Routes>
        <Route path="/subasta" element={<Subasta />} />
        <Route path="/login" element={<Login />} />
        <Route path="*" />
      </Routes>
    </div>
  );
}

export default App;
